pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./ModuleMapConsumer.sol";
import "../interfaces/IKernel.sol";

abstract contract Controlled is Initializable, ModuleMapConsumer {
    // controller address => is a controller
    mapping(address => bool) internal _controllers;
    address[] public controllers;

    function __Controlled_init(address[] memory controllers_, address moduleMap_) internal initializer {
        require(moduleMap_ != address(0), "bad address");
        for (uint256 i; i < controllers_.length; ++i) {
            require(controllers_[i] != address(0), "bad address");
        }
        for (uint256 i; i < controllers_.length; ++i) {
            _controllers[controllers_[i]] = true;
        }
        controllers = controllers_;
        __ModuleMapConsumer_init(moduleMap_);
    }

    function addController(address controller) external onlyOwner {
        _controllers[controller] = true;
        bool added;
        for (uint256 i; i < controllers.length; ++i) {
            if (controller == controllers[i]) {
                added = true;
            }
        }
        if (!added) {
            controllers.push(controller);
        }
    }

    modifier onlyOwner() {
        require(
            IKernel(moduleMap.getModuleAddress(Modules.Kernel)).isOwner(msg.sender),
            "Controlled::onlyOwner: Caller is not owner"
        );
        _;
    }

    modifier onlyManager() {
        require(
            IKernel(moduleMap.getModuleAddress(Modules.Kernel)).isManager(msg.sender),
            "Controlled::onlyManager: Caller is not manager"
        );
        _;
    }

    modifier onlyController() {
        require(_controllers[msg.sender], "Controlled::onlyController: Caller is not controller");
        _;
    }

    function isController(address controller) external view returns (bool status) {
        status = _controllers[controller];
    }

    function getAllControllers() external view returns (address[] memory currentControllers) {
        return controllers;
    }
}
","keccak256":"0xbe4c36b0a1e398f29a4f344b714870a95d5037cc38fce4e60cd66d5e6a6aef9b","license":"GPL-2.0"},"contracts/core/Interconnects.sol":{"content":"// SPDX-License-Identifier: GPL-2.0
pragma solidity 0.8.4;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "./Controlled.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "./ModuleMapConsumer.sol";
import "../interfaces/IInterconnects.sol";
import "../interfaces/IIntegrationMap.sol";
import "../interfaces/IUserPositions.sol";
import "../libraries/VerifySignature.sol";
import "../libraries/AddArr.sol";
import "hardhat/console.sol";

contract Interconnects is Initializable, ModuleMapConsumer, Controlled, IInterconnects, ReentrancyGuardUpgradeable {
    // Address of the relay account
    address payable private _relayAccount;

    // Token address => User address => Balance of tokens a user has in that token's liquidity pool
    mapping(address => mapping(address => lpData)) private _tokenUserLpBalances;

    // Token address => total liquidity pool for a token held by the contract
    mapping(address => uint256) private _tokenPoolLpBalances;

    // Token address => total protocol fees from bridging
    mapping(address => uint256) private _tokenProtocolFeeRewards;

    // Token address => The list of users currently LPing the token
    mapping(address => address[]) private _tokenLpUsers;

    // bytes 32 hash => whether this hash has been used before in a bridge or rse transaction
    mapping(bytes => bool) private relayTxns;

    // Token address => total RSE fees
    mapping(address => uint256) private _tokenRSEFees;

    uint32 public constant RSE_FEE_DENOMINATOR = 1_000_000;
    uint32 public rseFeeNumerator;

    /// @param controllers_ The addresses of the controlling contracts
    /// @param moduleMap_ Address of the Module Map
    /// @param relayAccount_ The address of the relay account that will control this account
    /// @param _rseFeeNumerator The numerator for RSE fees. Denominator is 1,000,000. So 10,000 = 1% fee.
    function initialize(
        address[] memory controllers_,
        address moduleMap_,
        address payable relayAccount_,
        uint32 _rseFeeNumerator
    ) external initializer {
        require(relayAccount_ != address(0), "bad address");

        __Controlled_init(controllers_, moduleMap_);
        _relayAccount = relayAccount_;
        rseFeeNumerator = _rseFeeNumerator;
    }

    modifier onlyRelayAccount() {
        require(msg.sender == _relayAccount, "Interconnects::onlyRelayAccount: Caller is not relay account");
        _;
    }

    modifier validateBridging(address[] memory tokens, uint256[] memory amounts) {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        require(
            tokens.length == amounts.length,
            "Interconnects::validateBridging: Length of tokens and amounts must be equal"
        );
        for (uint256 i; i < tokens.length; ++i) {
            require(
                integrationMap.getTokenAcceptingBridging(tokens[i]),
                "Interconnects::validateBridging: Token is not accepting bridging"
            );
        }
        _;
    }
    modifier validateRSE(RemoteStrategyExecutionBody memory req) {
        require(verifyRSE(req), "Interconnects::validateBridging: Signature is invalid");
        _;
    }

    /// @param relayAccount_ The address of the relay account
    function updateRelayAccount(address payable relayAccount_) external override onlyManager {
        _relayAccount = relayAccount_;
    }

    /// @return The address of the gas account
    function getRelayAccount() public view override returns (address) {
        return _relayAccount;
    }

    /// @param numerator fee numerator
    function updateRSEFeeNumerator(uint32 numerator) external override onlyManager {
        rseFeeNumerator = numerator;
    }

    /// @notice User is allowed to LP whitelisted tokens
    /// @param user Address of the account LP-ing
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function provideLiquidity(
        address user,
        address[] calldata tokens,
        uint256[] calldata amounts
    ) external override onlyController {
        require(
            tokens.length == amounts.length,
            "Interconnects::provideLiquidity: Length of tokens and amounts must be equal"
        );

        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        address[] memory tokenArr = new address[](tokens.length);
        uint256[] memory amountArr = new uint256[](amounts.length);
        bool[] memory addArr = new bool[](tokens.length);
        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            require(
                integrationMap.getTokenAcceptingLping(tokens[tokenId]),
                "Interconnects::provideLiquidity: This token is not accepting LP positions"
            );
            address token = tokens[tokenId];
            require(
                amounts[tokenId] > 0 && amounts[tokenId] <= userPositions.userTokenBalance(token, user),
                "Interconnects::provideLiquidity: LP amount must be greater than zero and no more than the user's balance"
            );
            tokenArr[tokenId] = token;
            amountArr[tokenId] = amounts[tokenId];
            addArr[tokenId] = false;

            // Keep track of who is currently LPing
            if (_tokenUserLpBalances[token][user].position == 0) {
                _tokenLpUsers[token].push(user);
            }

            _tokenUserLpBalances[token][user].position += amounts[tokenId];
            _tokenPoolLpBalances[token] += amounts[tokenId];
        }
        userPositions.updateUserTokenBalances(tokenArr, user, amountArr, addArr);
        emit ProvideLiquidity(user, tokens, amounts);
    }

    /// @param user Address of the account LP-ing
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function takeLiquidity(
        address user,
        address[] calldata tokens,
        uint256[] calldata amounts
    ) external override onlyController {
        require(
            tokens.length == amounts.length,
            "Interconnects::takeLiquidity: Length of tokens and amounts must be equal"
        );

        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        address[] memory tokenArr = new address[](tokens.length);
        uint256[] memory amountArr = new uint256[](amounts.length);
        bool[] memory addArr = new bool[](tokens.length);

        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            address token = tokens[tokenId];
            require(
                amounts[tokenId] > 0 && amounts[tokenId] <= _tokenUserLpBalances[token][user].position,
                "Interconnects::takeLiquidity: LP amount must be greater than zero and no more than the user's balance for the token"
            );
            require(
                amounts[tokenId] <= _tokenPoolLpBalances[token],
                "Interconnects::takeLiquidity: LP amount must be no more than the available amount in the token pool"
            );

            tokenArr[tokenId] = token;
            amountArr[tokenId] = amounts[tokenId];
            addArr[tokenId] = true;

            _tokenUserLpBalances[token][user].position -= amounts[tokenId];
            _tokenPoolLpBalances[token] -= amounts[tokenId];

            // User has withdrawn all liquidity, so remove from list of LP users
            if (_tokenUserLpBalances[token][user].position == 0) {
                // Iterate through tokenLpUsers[token] and remove this user
                for (uint256 lpUserIdx; lpUserIdx < _tokenLpUsers[token].length; lpUserIdx++) {
                    if (_tokenLpUsers[token][lpUserIdx] == user) {
                        _tokenLpUsers[token][lpUserIdx] = _tokenLpUsers[token][_tokenLpUsers[token].length - 1];
                        _tokenLpUsers[token].pop();
                        break;
                    }
                }
            }
        }
        userPositions.updateUserTokenBalances(tokenArr, user, amountArr, addArr);
        emit TakeLiquidity(user, tokens, amounts);
    }

    /// @notice User is allowed to claim fees
    /// @param user Address of the account LP-ing
    /// @param tokens Array of the token addresses
    function claimLpFeeRewards(address user, address[] calldata tokens) external override onlyController nonReentrant {
        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        uint256[] memory amounts = new uint256[](tokens.length);
        bool[] memory add = new bool[](tokens.length);

        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            address token = tokens[tokenId];
            uint256 fees = _tokenUserLpBalances[token][user].rewards;
            require(fees > 0, "Interconnects::claimLpFees: LP fee reward balance must be greater than zero");
            _tokenUserLpBalances[token][user].rewards = 0;
            amounts[tokenId] = fees;
            add[tokenId] = true;
        }
        userPositions.updateUserTokenBalances(tokens, user, amounts, add);

        emit ClaimLpFeeRewards(user, tokens);
    }

    /// @dev Wrapper around userPositions func to decrease user's token balance
    /// @param user user bridging
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function bridgeFrom(
        address user,
        address[] memory tokens,
        uint256[] memory amounts
    ) external override onlyRelayAccount validateBridging(tokens, amounts) nonReentrant {
        // create add array with a false boolean for each address in tokens
        bool[] memory addArr = new bool[](tokens.length);
        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        userPositions.updateUserTokenBalances(tokens, user, amounts, addArr);
        emit BridgeFrom(user, tokens, amounts);
    }

    /// @dev Wrapper around userPositions func to increase user's token balance
    /// @param user user bridging
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function undoBridgeFrom(
        address user,
        address[] memory tokens,
        uint256[] memory amounts
    ) external override onlyRelayAccount validateBridging(tokens, amounts) nonReentrant {
        // create add array with a true boolean for each address in tokens
        bool[] memory addArr = new bool[](tokens.length);
        for (uint256 i; i < tokens.length; ++i) {
            addArr[i] = true;
        }
        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        userPositions.updateUserTokenBalances(tokens, user, amounts, addArr);
        emit UndoBridgeFrom(user, tokens, amounts);
    }

    /// @dev Wrapper around userPositions func, updateTokenPoolLpBalances, and feeHandler
    /// @param user user bridging
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function bridgeTo(
        address user,
        address[] memory tokens,
        uint256[] memory amounts
    ) external override onlyRelayAccount validateBridging(tokens, amounts) nonReentrant {
        // create add array with a true boolean for each address in tokens
        bool[] memory addArr = new bool[](tokens.length);
        bool[] memory subArr = new bool[](tokens.length);
        for (uint256 i; i < tokens.length; ++i) {
            addArr[i] = true;
        }
        (
            uint256[] memory protocolFees,
            uint256[] memory liquidityProviderFees,
            uint256[] memory netBridgeAmounts
        ) = calculateBridgeFeesAndNetAmount(tokens, amounts);
        updateTokenPoolLpBalances(tokens, amounts, subArr);
        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        userPositions.updateUserInterconnectBalances(tokens, user, netBridgeAmounts, addArr);
        for (uint256 i; i < tokens.length; ++i) {
            address token = tokens[i];
            uint256 lpFee = liquidityProviderFees[i];
            uint256 protocolFee = protocolFees[i];
            updateTokenUserLpFeeRewardBalances(token, lpFee);
            _tokenProtocolFeeRewards[token] += protocolFee;
        }
        emit BridgeTo(user, tokens, amounts);
    }

    function remoteStrategyExecution(RemoteStrategyExecutionBody memory req)
        external
        override
        onlyRelayAccount
        validateRSE(req)
        nonReentrant
    {
        markTxnAsCompleted(req.signature);
        IUserPositions userPositions = IUserPositions(moduleMap.getModuleAddress(Modules.UserPositions));
        uint256[] memory fees = calculateRSEFees(req.movements);
        address[] memory tokens = new address[](req.movements.length);
        for (uint256 i; i < req.movements.length; ++i) {
            tokens[i] = req.movements[i].token;
            _tokenRSEFees[req.movements[i].token] += fees[i];
        }

        // if they are entering a strategy remotely, we want to take fees before entering
        if (req.enterStrat) {
            // taking fees = decreasing their local balance by the amount of the fee for each token
            userPositions.updateUserTokenBalances(tokens, req.user, fees, new bool[](tokens.length));
        }

        userPositions._remoteStrategyExecution(req.strategyId, req.user, req.movements, req.enterStrat);

        // if they are exiting a strategy remotely, we want to take the fees after they exit the strategy
        if (!req.enterStrat) {
            userPositions.updateUserTokenBalances(tokens, req.user, fees, new bool[](tokens.length));
        }

        emit RSE(req);
    }

    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    /// @param add Array of boolean values, true if adding, false if removing
    function updateTokenPoolLpBalances(
        address[] memory tokens,
        uint256[] memory amounts,
        bool[] memory add
    ) internal {
        require(
            tokens.length == amounts.length && tokens.length == add.length,
            "Interconnects::updateTokenPoolLpBalances: Length of tokens, amounts, and add/subtract must be equal"
        );

        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));

        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            require(
                integrationMap.getTokenAcceptingLping(tokens[tokenId]),
                "Interconnects::updateTokenPoolLpBalances: This token is not accepting LP positions"
            );

            uint256 newBalance;
            if (add[tokenId]) {
                newBalance = _tokenPoolLpBalances[tokens[tokenId]] + amounts[tokenId];
            } else {
                newBalance = _tokenPoolLpBalances[tokens[tokenId]] - amounts[tokenId];
            }

            _tokenPoolLpBalances[tokens[tokenId]] = newBalance;
        }
        emit UpdateTokenPoolLpBalances(tokens, amounts, add);
    }

    /// @param asset Address of the ERC20 token contract
    /// @param lpTransferFeeAmt Total fee amount which will be divided among the LPers
    function updateTokenUserLpFeeRewardBalances(address asset, uint256 lpTransferFeeAmt) internal {
        uint256 totalAmountAllocated = getTokenPoolLpActivePositions(asset);
        for (uint256 lpUserIdx; lpUserIdx < _tokenLpUsers[asset].length; lpUserIdx++) {
            address lpUser = _tokenLpUsers[asset][lpUserIdx];
            // User gets a portion of the fee proportional to their share of the pool
            _tokenUserLpBalances[asset][lpUser].rewards +=
                (lpTransferFeeAmt * _tokenUserLpBalances[asset][lpUser].position) /
                totalAmountAllocated;
        }
    }

    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function calculateBridgeFeesAndNetAmount(address[] memory tokens, uint256[] memory amounts)
        internal
        view
        returns (
            uint256[] memory protocolFees,
            uint256[] memory liquidityProviderFees,
            uint256[] memory netBridgeAmounts
        )
    {
        IIntegrationMap integrationMap = IIntegrationMap(moduleMap.getModuleAddress(Modules.IntegrationMap));
        uint32 targetLiquidityRatioDenominator = integrationMap.getTargetLiquidityRatioDenominator();
        uint32 kValueDenominator = integrationMap.getTransferFeeKValueDenominator();
        uint32 protocolFeeDenominator = integrationMap.getTransferFeePlatformRatioDenominator();
        protocolFees = new uint256[](tokens.length);
        liquidityProviderFees = new uint256[](tokens.length);
        netBridgeAmounts = new uint256[](tokens.length);
        for (uint256 tokenId; tokenId < tokens.length; tokenId++) {
            address token = tokens[tokenId];
            uint256 protocolFeeNumerator = integrationMap.getTokenTransferFeePlatformRatioNumerator(token);

            // x is the unallocated (currently available) liquidity divided by the target liquidity
            uint256 x = (_tokenPoolLpBalances[token] * targetLiquidityRatioDenominator) /
                (integrationMap.getTokenTargetLiquidityRatioNumerator(token) * getTokenPoolLpActivePositions(token));

            uint256 totalFee = (integrationMap.getTokenTransferFeeKValueNumerator(token) * amounts[tokenId]) /
                (kValueDenominator * x);

            protocolFees[tokenId] = (totalFee * protocolFeeNumerator) / protocolFeeDenominator;
            liquidityProviderFees[tokenId] = totalFee - protocolFees[tokenId];
            netBridgeAmounts[tokenId] = amounts[tokenId] - totalFee;
        }

        return (protocolFees, liquidityProviderFees, netBridgeAmounts);
    }

    /// @param movements tokens and amounts
    function calculateRSEFees(IUserPositions.TokenMovement[] memory movements)
        internal
        view
        returns (uint256[] memory protocolFees)
    {
        protocolFees = new uint256[](movements.length);
        for (uint256 i; i < movements.length; ++i) {
            protocolFees[i] = (movements[i].amount * rseFeeNumerator) / RSE_FEE_DENOMINATOR;
        }
        return protocolFees;
    }

    /// @param asset Address of the ERC20 token contract
    /// @param user Address of the user account
    function getTokenUserLpBalance(address asset, address user) public view override returns (uint256) {
        return _tokenUserLpBalances[asset][user].position;
    }

    /// @param asset Address of the ERC20 token contract
    function getTokenPoolLpBalance(address asset) public view override returns (uint256) {
        return _tokenPoolLpBalances[asset];
    }

    /// @dev this returns the sum of all active LP positions for a given token. This is different than the LP balance, as the LP balance is the available amount of this sum. This number is gte the LP balance, usually greater than.
    /// @param asset Address of the ERC20 token contract
    function getTokenPoolLpActivePositions(address asset) public view override returns (uint256) {
        uint256 sum = 0;
        address[] memory lpUsers = _tokenLpUsers[asset];
        for (uint256 lpUserIdx; lpUserIdx < lpUsers.length; lpUserIdx++) {
            address lpUser = lpUsers[lpUserIdx];
            sum += _tokenUserLpBalances[asset][lpUser].position;
        }
        return sum;
    }

    /// @param asset Address of the ERC20 token contract
    /// @param user Address of the user account
    function getTokenUserLpFeeRewardBalance(address asset, address user) public view override returns (uint256) {
        return _tokenUserLpBalances[asset][user].rewards;
    }

    /// @param asset Address of the ERC20 token contract
    function getTokenLpUsers(address asset) public view override returns (address[] memory) {
        return _tokenLpUsers[asset];
    }

    /// @param asset Address of the ERC20 token contract
    function getTokenProtocolFeeRewards(address asset) public view override returns (uint256) {
        return _tokenProtocolFeeRewards[asset];
    }

    /// @dev this function verifies that the signature is from the signer and contains the correct hashed contents
    /// @param req - RSE request as struct RemoteStrategyExecutionBody
    function verifyRSE(RemoteStrategyExecutionBody memory req) public pure returns (bool) {
        bytes32 messageHash = keccak256(abi.encode(req.user, req.strategyId, req.enterStrat, req.nonce, req.movements));
        bytes32 ethSignedMessageHash = VerifySignature.getEthSignedMessageHash(messageHash);
        return VerifySignature.recoverSigner(ethSignedMessageHash, req.signature) == req.user;
    }

    /// @dev this function hashes this data and marks it as a completed transaction
    /// @param signature - signature of the user
    function markTxnAsCompleted(bytes memory signature) internal {
        require(!relayTxns[signature], "Interconnects::markTxnAsCompleted: Already completed!");
        relayTxns[signature] = true;
    }
}
