pragma solidity 0.8.4;
import "./IUserPositions.sol";

interface IInterconnects {
    // ##### Events
    struct lpData {
        uint256 position;
        uint256 rewards;
    }

    struct RemoteStrategyExecutionBody {
        address user;
        uint256 strategyId;
        bool enterStrat;
        uint256 nonce;
        IUserPositions.TokenMovement[] movements;
        bytes signature;
    }

    event ProvideLiquidity(address indexed user, address[] tokens, uint256[] tokenAmounts);
    event TakeLiquidity(address indexed user, address[] tokens, uint256[] tokenAmounts);

    event ClaimLpFeeRewards(address indexed user, address[] tokens);

    event BridgeFrom(address indexed user, address[] tokens, uint256[] amounts);

    event UndoBridgeFrom(address indexed user, address[] tokens, uint256[] amounts);

    event BridgeTo(address indexed user, address[] tokens, uint256[] amounts);

    event RSE(RemoteStrategyExecutionBody req);

    event UpdateTokenPoolLpBalances(address[] tokens, uint256[] tokenAmounts, bool[] add);

    // ##### Functions
    /// @param relayAccount_ The address of relay account
    function updateRelayAccount(address payable relayAccount_) external;

    /// @return The address of the relay account
    function getRelayAccount() external view returns (address);

    function updateRSEFeeNumerator(uint32 number) external;

    /// @notice User is allowed to LP whitelisted tokens
    /// @param user Address of the account LP-ing
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function provideLiquidity(
        address user,
        address[] calldata tokens,
        uint256[] calldata amounts
    ) external;

    /// @param user Address of the account LP-ing
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function takeLiquidity(
        address user,
        address[] calldata tokens,
        uint256[] calldata amounts
    ) external;

    /// @param user Address of the account LP-ing
    /// @param tokens Array of the token addresses
    function claimLpFeeRewards(address user, address[] calldata tokens) external;

    // @param user Address of the account bridging
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function bridgeFrom(
        address user,
        address[] memory tokens,
        uint256[] memory amounts
    ) external;

    // @param user Address of the account bridging
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function undoBridgeFrom(
        address user,
        address[] memory tokens,
        uint256[] memory amounts
    ) external;

    // @param user Address of the account bridging
    /// @param tokens Array of the token addresses
    /// @param amounts Array of the token amounts
    function bridgeTo(
        address user,
        address[] memory tokens,
        uint256[] memory amounts
    ) external;

    // @param req remote strategy execution request as struct RemoteStrategyExecutionBody
    function remoteStrategyExecution(RemoteStrategyExecutionBody calldata req) external;

    /// @param asset Address of the ERC20 token contract
    /// @param account Address of the user account
    function getTokenUserLpBalance(address asset, address account) external view returns (uint256);

    /// @param asset Address of the ERC20 token contract
    function getTokenPoolLpBalance(address asset) external view returns (uint256);

    /// @param asset Address of the ERC20 token contract
    function getTokenPoolLpActivePositions(address asset) external view returns (uint256);

    /// @param asset Address of the ERC20 token contract
    /// @param account Address of the user account
    function getTokenUserLpFeeRewardBalance(address asset, address account) external view returns (uint256);

    /// @param asset Address of the ERC20 token contract
    function getTokenLpUsers(address asset) external view returns (address[] memory);

    /// @param asset Address of the ERC20 token contract
    function getTokenProtocolFeeRewards(address asset) external view returns (uint256);
}
