pragma solidity >=0.7.6;

/// @title AddArr
/// @notice A library for create a list of booleans that are true. Allows you to specify whether you want to add or subtract an int from a uint
/// @dev Used in Interconnects.col
library AddArr {
    function getAddArr(uint256 amount) internal pure returns (bool[] memory) {
        bool[] memory result = new bool[](amount);
        for (uint256 i; i < amount; ++i) {
            result[i] = true;
        }
        return result;
    }
}
